TagText_lang:
Vous pouvez vous allier à cette personne membre de la faction %s afin d’effectuer conjointement diverses activités d’instance.

|cffffffffActivités accessibles :|r
– donjons (groupes préconstitués) ;
– raids (hors file d’attente) ;
– JcJ coté ou non coté ;
– Gouffres.

|cffffffffActivités exclues :|r
– contenu extérieur.
